import React from 'react';
import { Box, Heading } from 'grommet';

const landing = props => {
  return (
    <React.Fragment>
      <Box height="50%" justify="end" align="center" animation="fadeIn"   border={{ color: 'brand', size: 'large' }}
>
        <Heading 
          color="dark-1" 
          size="small" 
        >
          Where to eat in
        </Heading>
      </Box>
      <Box height="50%" justify="start" align="center" alignContent="start"   border={{ color: 'brand', size: 'large' }}
>
        <Heading 
          color="status-warning" 
          size="large" 
          margin="none"
        >
          {props.location}
        </Heading>
      </Box>
    </React.Fragment>
  )
}

export default landing;
